import React from 'react';

const data ={
    id:{
        name : "김민상",
        description : "게으름뱅이"
    },
    gildong : {
        name : '홍길동',
        description: "칼잽이"
    }
};

const Profile = ({match}) =>{
    const { username } = match.params;
    const profile = data[username];
    if(!profile){
        return <div>존재하지 않는 사용자 입니다.</div>
    }
    return(
        <div>
            <h3>
                {username}({[profile.name]})
            </h3>
            <p>{profile.description}</p>
        </div>
    );
};
export default Profile;
